TEST_F(UbStreamTest, KernelLaunchWithFlag)
{
    rtError_t error;

    rtDevBinary_t devBin;
    void      *binHandle_;
    char       function_;
    uint32_t   binary_[32];
    void *args[] = {&error, NULL};
    devBin.magic = RT_DEV_BINARY_MAGIC_PLAIN;
    devBin.version = 2;
    devBin.length = sizeof(binary_);
    devBin.data = binary_;
    uint32_t   datdumpinfo[32];

    rtDavidSqe_t *sqe = (rtDavidSqe_t *)malloc(10 * sizeof(rtDavidSqe_t));
    uint64_t oldSqAddr = stream_->GetSqBaseAddr();
    uint64_t newSqAddr = reinterpret_cast<uint64_t>(sqe);
    stream_->SetSqBaseAddr(newSqAddr);

    error = rtDevBinaryRegister(&devBin, &binHandle_);
    EXPECT_EQ(error, RT_ERROR_NONE);

    error = rtBinaryRegisterToFastMemory(binHandle_);
    error = rtFunctionRegister(binHandle_, &function_, "foo", NULL, 0);
    EXPECT_EQ(error, RT_ERROR_NONE);

    rtArgsEx_t argsInfo = {};
    argsInfo.args = args;
    argsInfo.argsSize = sizeof(args);
    rtTaskCfgInfo_t taskCfgInfo = {};
    taskCfgInfo.qos = 1;
    taskCfgInfo.partId = 1;

    error = rtKernelLaunchWithFlagV2(&function_, 1, &argsInfo, NULL, (void *)stream_, 0, &taskCfgInfo);
    error = rtDevBinaryUnRegister(binHandle_);
    EXPECT_EQ(error, RT_ERROR_NONE);

    stream_->SetSqBaseAddr(oldSqAddr);
    free(sqe);

}

